import React, { Component } from "react";
 
class Contact extends Component {
  render() {
    return (

        <div>
        <h2>Contact me on different Socail Media</h2>
        <p>you can Contact me on:

         <a href="https://www.facebook.com/alexis.uwimana">#facebook</a> 
        </p>
        <p>you can follow me on GitHub twitter @
         <a href="https://twitter.com/alexisuwimana">alexisuwimana</a> 
        </p>
        <p>you can follow me on GitHub @
         <a href="https://github.com/alexisuwimana">alexisuwimana</a> 
        </p>
      </div>   

      
    );
  }
}
 


export default Contact;
